DROP TABLE IF EXISTS `shop_region`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `shop_region` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `region_code` varchar(20) NOT NULL COMMENT '地区编码',
  `region_name` varchar(50) NOT NULL COMMENT '地区名称',
  `parent_code` varchar(20) DEFAULT NULL COMMENT '父级地区编码',
  `region_level` tinyint(4) NOT NULL COMMENT '地区级别;1:省,2:市,3:区',
  `is_remote` tinyint(1) DEFAULT 0 COMMENT '是否偏远地区',
  `sort_order` int(11) DEFAULT 0 COMMENT '排序',
  `created_time` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `region_code` (`region_code`),
  KEY `idx_parent_code` (`parent_code`),
  KEY `idx_level` (`region_level`)
) ENGINE=InnoDB AUTO_INCREMENT=4089 DEFAULT CHARSET=utf8 COMMENT='地区信息表';
